define('Deprecated/ReaderGETJSON', [
   'Deprecated/ReaderAbstract'
], function(ReaderAbstract) {
   var ReaderGETJSON;

   /**
    * Специальный ридер для вызова методов через GET
    * @class Deprecated/ReaderGETJSON
    * @extends Deprecated/ReaderAbstract
    * @author Бегунов А.В.
    * @public
    * @deprecated
    */
   ReaderGETJSON = ReaderAbstract.extend(/** @lends Deprecated/ReaderGETJSON.prototype */{
      _columnsParseFnc: function(data) {
         var
            settings = [],
            res = JSON.parse(data);
         for (var i in res[0]) {
            settings.push({
               'n': i,
               't': 'Строка'
            });
         }
         return {
            'settings': settings,
            'pk': 0
         }
      },
      _dataParser: function(data) {
         var
            row,
            res = JSON.parse(data);
         for (var i in res) {
            row = [];
            for (var j in res[i]) {
               row.push(res[i][j])
            }
            this._notify('onNewRecord', row);
         }
      },
      _makeArgsForQuery: function(args) {
         return args;
      }
   });

   return ReaderGETJSON;
});